.header {
  position: fixed;
  display: flex;
  justify-content: space-between;
  top: 0;
  z-index: 10;
  width: 100%;
  height: 100px;
  box-shadow: 5px 5px 5px 5px #999;
  overflow: hidden;
}
.header:hover .header_bg {
  opacity: 1;
}
