sources.css\\index.scss:
* {
    margin: 0;
    padding: 0;
}

li {
    list-style: none;
}

a {
    display: block;
    text-decoration: none;
    color: black;
}


$box: 3px 2px 5px 2px #ccc;
$color: #C4D9F8;
$font-family: 'NanumSquare';
$font-family1: 'BodoniFLF';
$font-family2: 'BodoniFLF-Bold';

p,
a,
span,
div,
li {
    font-family: $font-family;
    font-size: 20px;
}

@font-face {
    font-family: 'BodoniFLF-Bold';
    src: url(../font/BodoniFLF-Bold.ttf);
    font-weight: bold;
}

@font-face {
    font-family: 'BodoniFLF';
    src: url(../font/BodoniFLF-Roman.ttf);
}

@import url("https://cdn.jsdelivr.net/gh/orioncactus/pretendard/dist/web/static/pretendard.css");


/***************************************************/


.header {
    position: fixed;
    display: flex;
    justify-content: space-between;
    top: 0;
    z-index: 10;
    width: 100%;
    height: 100px;
    box-shadow: 5px 5px 5px 5px #999;
    overflow: hidden;

    &:hover .header_bg {
        opacity: 1;
    }

    .header_bg {
        position: absolute;
        width: 100%;
        height: 100px;
        background-color: #fff;
        opacity: 0.4;
        z-index: -1;

    }

    .logo {
        margin-left: 10%;
        height: 100px;

        &:hover {
            >a {
                >img {
                    width: 100%;

                    &:nth-child(1) {
                        display: none;
                    }

                    &:nth-child(2) {
                        display: block;
                        transition: 0.3s;
                        width: 95%;
                        transform: translate(10px, 10px);

                    }
                }
            }

        }

        >a {
            width: 100px;
            height: 100px;

            >img {
                width: 100%;
                transition: 0.3s;

                &:nth-child(2) {
                    display: none;
                }
            }
        }


    }

    .lnb {
        width: 50%;
        height: 100px;
        text-align: center;
        line-height: 130px;
        margin-right: 1%;

        >ul {
            display: flex;
            justify-content: space-evenly;


            >li {
                margin-right: 20px;

                >a {
                    font-size: 25px;
                    font-family: $font-family2;
                    color: #222;

                    &:hover {
                        color: #999;
                    }
                }
            }
        }
    }
}

.indicate {
    position: absolute;
    z-index: 100;
    /*  top: 50%; */
    right: 20px;
    width: 90px;

    >li {

        text-align: center;
        margin-bottom: 30px;
        cursor: pointer;

        &:last-child {
            margin-bottom: 0;
        }

        >a {
            >p {
                width: 90px;
                margin-right: 30px;
                display: none;
                font-weight: bold;
                font-family: $font-family1;
            }

            .indi_btn {
                margin: 0 auto;
                width: 20px;
                height: 20px;
                width: 20px;
                height: 20px;
                border-radius: 50%;
                background-color: #eee;
            }
        }

        &.on {
            >a {
                >p {
                    display: block;
                }

                .indi_btn {
                    display: none;
                }
            }
        }
    }

}


.wrap {
    >div {
        width: 100%;
        height: 100vh;

        .page_box {
            padding: 120px 100px 0px 100px;
            box-sizing: border-box;
            width: 100%;
            height: 100%;

            >p {
                font-family: $font-family1;
                font-size: 50px;
                margin-left: 100px;
                color: #ccc;
            }
        }
    }

    .main_page {
        position: relative;
        overflow: hidden;

        >img {
            position: absolute;
            z-index: -1;
            width: 100%;
        }

        .main_box {
            width: 1300px;
            margin: 0 auto;
            padding-top: 100px;
            box-sizing: border-box;

            .typing {
                margin-top: 25%;
                margin-left: 230px;
                width: 100%;
                height: 55px;
                display: flex;
                justify-content: center;
                align-items: flex-end;

                >p {
                    font-size: 30px;
                    line-height: 40px;
                    color: #fff;
                    font-family: $font-family;
                }

                >img {
                    filter: invert(100%);
                    width: 20px;
                    height: 20px;
                    margin-bottom: 30px;
                }

                .text {
                    font-family: $font-family;
                    font-size: 30px;

                    &::after {
                        content: '';
                        border-right: 2px solid #777;
                        animation: cursor .9s infinite steps(2);
                    }
                }
            }

            .resume {
                margin-top: 50px;
                margin-left: 500px;
                width: 400px;
                overflow: hidden;


                >ul {
                    display: flex;

                    >img {
                        width: 20px;
                        height: 20px;
                    }

                    >li {
                        margin-left: 10px;
                        cursor: pointer;

                        >a {
                            color: #fff;

                            &:hover {
                                font-weight: bold;
                            }
                        }
                    }
                }
            }

            .my_image {
                position: absolute;
                bottom: 50px;
                left: 300px;
                width: 500px;
                height: 700px;
                border-radius: 50% / 50%;
                overflow: hidden;
                z-index: -1;
                box-shadow: 5px 5px 5px 5px #999;

                >img {
                    /* display: none; */
                    width: 180%;
                    transform: translate(-130px, -175px);
                }
            }

            .tag {
                position: absolute;
                bottom: 150px;
                left: 200px;
                width: 200px;
                height: 50px;
                line-height: 50px;
                text-align: center;
                background-color: $color;
                box-shadow: 2px 2px 2px 2px #999;
                color: #fff;
                font-weight: bold;
                /* letter-spacing: 7px; */
                border-radius: 10px 0 0 10px;
            }

        }

    }

    #page1 {
        .page_box {
            .page_inner {
                width: 100%;
                height: auto;
                background-color: #F9F9F9;
                border-radius: 100px;
                padding-bottom: 40px;

                .page1_tit {
                    display: flex;

                    >img {
                        margin-top: 30px;
                        width: 170px;
                        margin-left: 100px;
                    }

                    >p {
                        margin-left: 25px;
                        margin-top: 90px;
                        color: #879ec2;
                        font-weight: bold;
                        font-size: 20px;
                    }
                }

                .page1_txt {
                    width: 100%;
                    height: 190px;
                    background-color: #fff;
                    padding: 0 133px;
                    box-sizing: border-box;
                    justify-content: space-evenly;

                    >div {
                        width: 1300px;
                        margin: 0 auto;

                        >ul {
                            width: 540px;
                            margin: 0 auto;
                            float: left;
                            margin-right: 135px;
                            padding-top: 30px;

                            &:last-child {
                                width: 625px;
                                margin-right: 0;
                            }

                            li {
                                float: left;

                                >img {
                                    display: block;
                                    width: 16px;
                                    margin-right: 20px;
                                    margin-bottom: 30px;
                                }

                                >p {
                                    font-size: 20px;
                                    margin-bottom: 30px;

                                }


                            }

                            .info {
                                margin-left: 100px;
                            }

                        }

                    }




                }

                >ul {
                    display: flex;
                    width: 1120px;
                    margin: 0 auto;
                    margin-top: 30px;
                    text-align: center;

                    >li {
                        width: 350px;
                        height: 340px;
                        border: 5px solid $color;
                        margin-right: 35px;
                        border-radius: 40px;
                        box-shadow: $box;

                        &:nth-child(3) {
                            margin-right: 0;
                        }

                        &:nth-child(1)>h5 {
                            margin-bottom: 80px;
                        }

                        &:nth-child(2)>h5 {
                            margin-bottom: 75px;
                        }

                        &:nth-child(3)>h5 {
                            margin-bottom: 35px;
                        }

                        >h5 {
                            width: 80%;
                            margin: 20px auto;
                            font-size: 35px;
                            color: $color;
                            border-bottom: 3px solid $color;
                        }

                        >p {
                            margin-bottom: 30px;
                            font-size: 18px;
                            font-weight: bold;

                            >span {
                                font-weight: normal;
                            }
                        }

                        >span {
                            padding-bottom: 10px;
                            display: block;
                            font-size: 18px;
                        }
                    }


                }
            }
        }
    }

    #page2 {
        .page_box {
            position: relative;

            >p {
                margin-left: 210px;
            }

            .blink5 {
                position: absolute;
                top: 300px;
                left: 480px;
                animation: blink-effect 2s step-end infinite;
                color: $color;
                font-weight: bold;

            }

            .page_img {
                top: 60px;
                left: 180px;
                width: 150px;
                height: 150px;
                position: absolute;

                >img {
                    width: 100%;
                }
            }

            .page_inner {
                width: 100%;
                height: auto;

                .my_skill {
                    width: 1000px;
                    padding: 0 0 200px 0px;
                    box-sizing: border-box;
                    margin: 0 auto;
                    margin-top: 70px;
                    transform: translateX(70px);
                    cursor: pointer;


                    >li {
                        float: left;
                        margin-right: 150px;
                        height: 100px;
                        width: 100px;
                        position: relative;
                        transform: scale(2);

                        >.inner {
                            position: absolute;
                            z-index: 6;
                            top: 50%;
                            left: 50%;
                            height: 80px;
                            width: 80px;
                            margin: -40px 0 0 -40px;
                            background: #fff;
                            border-radius: 100%;
                            box-shadow: 0 1px 0 rgba(0, 0, 0, 0.2);

                            >img {
                                width: 100%;
                            }
                        }

                        .numb,
                        .numb1,
                        .numb2,
                        .numb3 {
                            position: absolute;
                            bottom: -30px;
                            left: 50%;
                            transform: translate(-50%, -50%);
                            z-index: 10;
                            font-size: 14px;
                            font-weight: bold;
                        }

                        .circle {
                            .bar {
                                position: absolute;
                                height: 100%;
                                width: 100%;
                                background: #eee;
                                -webkit-border-radius: 100%;
                                clip: rect(0px, 100px, 100px, 50px);

                                .progress {
                                    position: absolute;
                                    height: 100%;
                                    width: 100%;
                                    -webkit-border-radius: 100%;
                                    clip: rect(0px, 50px, 100px, 0px);
                                    background: $color;
                                }
                            }

                            .left {
                                .progress {
                                    z-index: 1;
                                    transform: rotate(180deg);
                                }
                            }

                            .right,
                            .right1,
                            .right2,
                            .right3 {
                                z-index: 3;
                                transform: rotate(180deg);

                                .progress {
                                    animation-delay: 3s;
                                }
                            }

                            @keyframes right {
                                100% {
                                    transform: rotate(162deg);
                                }

                            }

                            @keyframes right1 {
                                100% {
                                    transform: rotate(162deg);
                                }

                            }

                            @keyframes right2 {
                                100% {
                                    transform: rotate(108deg);
                                }

                            }

                            @keyframes right3 {
                                100% {
                                    transform: rotate(72deg);
                                }

                            }
                        }
                    }

                }

                .skill_txt {
                    width: 1300px;
                    margin: 30px auto;

                    height: 120px;
                    border: 5px solid $color;
                    border-radius: 20px;
                    /*   background-color: $color; */

                    >p {
                        padding-top: 35px;
                        box-sizing: border-box;
                        text-align: center;
                        font-weight: bold;
                        line-height: 30px;
                    }

                    .skill_page {
                        display: none;

                        >h5 {
                            width: 40%;
                            text-align: center;
                            line-height: 120px;
                            font-size: 30px;
                            float: left;
                        }

                        >p {
                            margin-top: 25px;
                            float: left;
                            width: 60%;

                        }

                    }
                }

                .skill_2 {
                    width: 910px;
                    margin: 0px auto;
                    overflow: hidden;

                    >li {
                        float: left;
                        width: 130px;
                        height: 130px;

                        &:nth-child(1) {
                            >img {
                                transform: translateY(40px);
                            }
                        }

                        &:nth-child(2) {
                            >img {
                                transform: translate(10px, 30px);
                            }
                        }


                        >img {
                            width: 100%;
                        }
                    }
                }

                .skill_3 {
                    width: 780px;
                    margin: 0 auto;
                    overflow: hidden;
                    margin-bottom: 50px;

                    >li {
                        float: left;
                        width: 130px;
                        height: 130px;

                        >img {
                            width: 100%;
                        }
                    }
                }
            }


        }
    }

    #page3 {
        position: relative;

        >img {
            width: 100%;
            height: 100vh;
        }

        .page_box {
            top: 0;
            position: absolute;

            >p {
                width: 300px;
                color: #fff;
            }

            >.blink3,
            .blink4 {
                position: absolute;
                top: 145px;
                left: 730px;
                color: #fff;
                font-weight: bold;
                z-index: 100;
                animation: blink-effect 2s step-end infinite;

            }

            .blink4 {
                top: 628px;
                left: 1050px;
                color: $color;
            }

            .Project_tab {
                position: absolute;
                top: 135px;
                left: 400px;
                width: 320px;
                overflow: hidden;
                border-bottom: 1px solid #fff;


                >li {
                    width: 80px;
                    font-size: 35px;
                    font-family: $font-family1;
                    float: left;
                    color: #fff;
                    text-align: center;
                    cursor: pointer;
                    opacity: 0.5;

                    &:hover {
                        color: #ccc;
                        opacity: 1;
                    }
                }

                .on {
                    color: #fff;
                    border-bottom: 3px solid #fff;
                    opacity: 1;
                }
            }

            .Project_sheet {
                >li {
                    display: none;
                    width: 100%;
                    height: 200px;
                    margin-top: 30px;

                    .tab_img {
                        position: absolute;
                        top: 260px;
                        left: 200px;
                        width: 800px;

                        >img {
                            width: 100%;
                        }
                    }

                    .tab_inner {
                        width: 100%;
                        height: 365px;
                        margin-top: 150px;
                        background-color: #fff;
                        padding: 20px 0 20px 1000px;
